import { Nav, Navbar, Container } from "react-bootstrap";
import "../../Assets/NavBar.css";

const NavBar = (props) => {
  return (
    <Navbar bg="primary" variant="dark">
      <Container>
        <Navbar.Brand>Task Scheduler</Navbar.Brand>
        <Nav className="me-auto"></Nav>
      </Container>
    </Navbar>
  );
};

export default NavBar;
